    public static int subarrayBitwiseORs(int[] array) {
        if(array == null || array.length ==1)
            return 1;
        int[] nums = array;//removeDuplicates(array);
        int[][] dp = createDPStruc(nums);

        Set<Integer> numSet = new HashSet<>();
        for(int i = 0;i<nums.length;i++){
            numSet.add(nums[i]);
        }
        populateNumSet(dp,numSet,nums);
        return numSet.size();
    }

    public static void populateNumSet(int[][] dp,Set<Integer> numSet,int[] nums){
        for(int i =0; i<nums.length;i++){
            for(int j = i+1; j<nums.length; j++){
                dp[i][j] = dp[i][j-1] | nums[j];
                numSet.add(dp[i][j]);
            }
        }
    }

    public static int[][] createDPStruc(int[] nums){
        int[][] dp = new int[nums.length][nums.length];
        for(int i=0; i<nums.length; i++){
            for(int j=0; j <nums.length; j++){
                if(i==j){
                    dp[i][j] = nums[i];
                }else{
                    dp[i][j] = 0;
                }
            }
        }
        return dp;
    }

    public static int[] removeDuplicates(int[] array){
        Set<Integer> numSet = new HashSet<>();
        for(int i=0; i<array.length;i++){
            if(!numSet.contains(array[i])){
                numSet.add(array[i]);
            }
        }
        int[] ret = new int[numSet.size()];
        int j =0;
        for(Integer num : numSet){
            ret[j++] = num;
        }
        return ret;
    }
